import React, { Component } from 'react'
import logo from '../Header/logoShuhai.png';
import QRFacebook from '../QRFacebook.png';
import './Footer.css';
import { Button } from 'react-bootstrap';
import AdminPage from '../Pages/AdminPage/AdminPage';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
export default class Footer extends Component {
    render() {
        return (
            <div className="main-footer">
                <div className="footer-container">
                <img className="footer-logo"
                        src={logo}
                        height="10%"
                        width="10%"
                        
                        alt="logo"
                        
                        />
                    <div className="row">
                    
                        {/* Column 1 */}
                    <div className="col-md-3-info col-sm-6">
                       
                        <h4>Марія Шугай</h4>
                        
                            <p>Психолог, психотерапевт.
                            Кандидат психологічних наук, доцент.</p>
                            <p>Сертифікований та акредитований гештальт-терапевт, керівник навчальних та терапевтичних програм.
                            </p>
                       
                    </div>
                    {/* Column 2 */}
                    <div className="col-md-3 col-sm-6">
                       
                        <h4>Контакти</h4>
                        
                        <ul className="reference-for-contacts">
                            <li>+380 50 375 45 76</li>
                            <li>+380 68 059 81 35</li>
                            <li>mshugay@gmail.com</li>
                        </ul>
                    </div>
                    {/* Column 3 */}
                    <div className="col-md-3 col-sm-6">
                      
                        <h4>Соціальні мережі</h4>
                        
                        <div className="reference-for-contacts">
                            <a href="https://www.facebook.com/merypsyholog/">
                                    Facebook
                            </a>
                           
                        </div>
                          {/* <img className="qr-code"
                             src={QRFacebook}
                             height="60%"
                             width="50%"
                             
                             alt="logo"
                            /> */}
                    </div>
                    </div>
                    
                    </div>
                   
                    

            </div>
        )
    }
}
